import React from 'react';
import{ListContainer, Row, Text} from "./style"


function TodoList({todos}) {
    console.log(todos, 'hi')
  return (
    <div>
        <ListContainer>
            {/* render all todos in bullet points */}
            {todos?.map((todo) => {
            <Row key={todo._id}>
                <Text>{todo.text}</Text>
            </Row>
            })}
        </ListContainer>
    </div>
  );
}

export default TodoList;
